  render(){
    return(
        <Container>
          <Row>
            <Col>
            <div className="copyBlock">
              <h1>Hello, Manny</h1>
              <p>lNulla vitae elit libero, a pharetra augue. Maecenas faucibus mollis interdum.</p>
            </div>
            </Col>
          </Row>
        </Container>
    )
}
}

export default CopyBlock;
